create table OP_PRM_LINE
(
  LINE_ID     CHAR(2) not null,
  VERSION_NO  CHAR(10) not null,
  LINE_NAME   VARCHAR2(50) not null,
  RECORD_FLAG CHAR(1) not null,
  LCC_IP      VARCHAR2(15),
  LCC_LINE_ID CHAR(2),
  SEQUENCE    CHAR(2) default '00' not null
);
comment on column OP_PRM_LINE.LINE_ID
  is '线路代码';
comment on column OP_PRM_LINE.LINE_NAME
  is '线路名称';
comment on column OP_PRM_LINE.LCC_IP
  is '线路IP';
comment on column OP_PRM_LINE.LCC_LINE_ID
  is 'LCC线路ID';
comment on column OP_PRM_LINE.SEQUENCE
  is '序号';
alter table OP_PRM_LINE
  add constraint OP_PRM_LINE_PK primary key (LINE_ID, VERSION_NO, RECORD_FLAG);



create table OP_PRM_STATION
(
  LINE_ID        CHAR(2) not null,
  STATION_ID     CHAR(2) not null,
  CHINESE_NAME   VARCHAR2(20),
  ENGLISH_NAME   VARCHAR2(50),
  SC_IP          VARCHAR2(15),
  CONTC_ID       CHAR(2),
  RECORD_FLAG    CHAR(1) not null,
  LCC_IP         CHAR(15),
  VERSION_NO     CHAR(10) not null,
  SEQUENCE       CHAR(2) default '00',
  BELONG_LINE_ID CHAR(2) default '00'
);
comment on table OP_PRM_STATION
  is '车站表（过期）';
comment on column OP_PRM_STATION.LINE_ID
  is '线路ID';
comment on column OP_PRM_STATION.STATION_ID
  is '车站ID';
comment on column OP_PRM_STATION.CHINESE_NAME
  is '车站中文名称';
comment on column OP_PRM_STATION.ENGLISH_NAME
  is '车站英文名称';
comment on column OP_PRM_STATION.SC_IP
  is '车站计算机的IP地址';
comment on column OP_PRM_STATION.CONTC_ID
  is '运营商ID';
comment on column OP_PRM_STATION.LCC_IP
  is 'SC所属LCC的ip地址';
comment on column OP_PRM_STATION.SEQUENCE
  is '序号';
comment on column OP_PRM_STATION.BELONG_LINE_ID
  is '所属线路';
alter table OP_PRM_STATION
  add constraint PK_OP_PRM_STATION primary key (LINE_ID, STATION_ID, RECORD_FLAG, VERSION_NO);



create table OP_PRM_TRANSFER_STATION
(
  LINE_ID             CHAR(2) not null,
  STATION_ID          CHAR(2) not null,
  TRANSFER_LINE_ID    CHAR(2) not null,
  TRANSFER_STATION_ID CHAR(2) not null,
  RECORD_FLAG         CHAR(1) not null,
  VERSION_NO          CHAR(10) not null
);
alter table OP_PRM_TRANSFER_STATION
  add constraint PK_OP_PRM_TRANSFER_STATION primary key (LINE_ID, STATION_ID, TRANSFER_LINE_ID, TRANSFER_STATION_ID, RECORD_FLAG, VERSION_NO);



